def dijkstra_reverse_string(graph, start, end):
    """
    Find the shortest path in a graph using Dijkstra's algorithm.

    Args:
        graph (dict): A dictionary representing the graph where keys are nodes and values are lists of tuples (neighbor, weight).
        start (str): The starting node.
        end (str): The target node.

    Returns:
        list: The shortest path from start to end.
    """
    priority_queue = [(0, start, [])]
    visited = set()

    while priority_queue:
        (cost, current_node, path) = heapq.heappop(priority_queue)

        if current_node in visited:
            continue

        visited.add(current_node)
        path = path + [current_node]

        if current_node == end:
            return path

        for neighbor, weight in graph.get(current_node, []):
            if neighbor not in visited:
                heapq.heappush(priority_queue, (cost + weight, neighbor, path))

    return []


